import React from 'react';
import logo from '../images/logo.png';
import banner from '../images/backimg.png';
import '../../App.css';
// import "bootstrap/dist/css/bootstrap.min.css";  
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import glb from '../images/globes.png'
import findd from '../images/DreamCourse.png'
import asit from '../images/assistance.png'
import engl from '../images/testPrep.png'
import aust from '../images/austril.jpeg'
import uk from '../images/united-kingdom.jpg'
import canada from '../images/canadaa.jpg'
import us from '../images/us.jpg'
import { Link } from "react-router-dom";




import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

const YourComponent = () => {
  const particlesInit = async (engine) => {
    await loadFull(engine);
  };

  return (
    <div className="pg2">
      {/* Particle Background */}
      <Particles
        id="tsparticles"
        init={particlesInit}
        options={{
          background: {
            color: "#f4f4f4", // Change background color as needed
          },
          particles: {
            number: {
              value: 50,
            },
            color: {
              value: "#007bff",
            },
            shape: {
              type: "circle",
            },
            opacity: {
              value: 0.7,
            },
            size: {
              value: 3,
            },
            move: {
              enable: true,
              speed: 2,
              direction: "none",
              random: false,
              straight: false,
              outModes: "out",
            },
          },
        }}
      />

      <h2 className="hd2">
        Start Your Higher Education Journey with{" "}
        <span className="highlight">AbroadOptions Overseas Consultants</span> and open
        yourself to a whole new world full of opportunities.
      </h2>
      <br />

      {/* Navbar with Dropdown */}
      <header className="header">
        <nav className="custom-navbar">
          <ul className="nav-links">
            <li className="dropdown">
              <a href="#">Study in Abroad</a>
              <ul className="dropdown-menu">
                <li><a href="#">Study in USA</a></li>
                <li><a href="#">Study in UK</a></li>
                <li><a href="#">Study in Canada</a></li>
                <li><a href="#">Study in Australia</a></li>
              </ul>
            </li>
            <li><a href="#">About Us</a></li>
            <li><a href="#">Study Loans</a></li>
            <li><a href="#">English Tests</a></li>
            <li><a href="#">Blog</a></li>
            <li><a href="#">Contact Us</a></li>
          </ul>
        </nav>
      </header>

      <br /><br />
      <div className="glb">
        <img src={glb} alt="glbimg" />
      </div>
      <br /><br />

      {/* Advantage Section */}
      <h1 className="adv">Unimart Overseas <span>Advantage</span></h1>
      <div className="adpic">
        <div className="find">
          <img src={findd} alt="find" />
          <p>Finding the Program<br /> That’s Right for You</p>
        </div>
        <div className="find">
          <img src={asit} alt="find" />
          <p>Curated Expert-led<br /> Application Assistance</p>
        </div>
        <div className="find">
          <img src={engl} alt="find" />
          <p>English Assessment<br />Test Prep On-the-go</p>
        </div>
      </div>
    </div>
  );
};

export default YourComponent;
